import './App.css';
import React from 'react';
import {StyleSheet, View} from 'react-native';

const Flex = () => {
  return (
  <View style={styles.index}>
  </View>
)};

const styles = StyleSheet.create({
  index: {
    flex: 1,
    flexDirection: 'row',
    backgroundColor: 'green',
    height: 700,
    padding: 20,
  }
})

export default Flex;
